import { useState } from "react";
import { ProSidebar, Menu, MenuItem } from "react-pro-sidebar";
import { Box, IconButton, Typography, useTheme } from '@mui/material';
import 'react-pro-sidebar/dist/css/styles.css';
import { Link } from "react-router-dom";  //allows so that when you click a link, it takes you to the page you are clicking
import { tokens } from "../../theme"
import HomeOutlinedIcon from "@mui/icons-material/HomeOutlined"; 
import PeopleOutlinedIcon from "@mui/icons-material/PeopleOutlined"; 
import ContactsOutlinedIcon from "@mui/icons-material/ContactsOutlined"; 
import ReceiptOutlinedIcon from "@mui/icons-material/ReceiptOutlined"; 
import PersonOutlinedIcon from "@mui/icons-material/PersonOutlined"; 
import CalendarTodayOutlinedIcon from "@mui/icons-material/CalendarTodayOutlined"; 
import HelpOutlineOutlinedIcon from "@mui/icons-material/HelpOutlined"; 
import BarChartOutlinedIcon from "@mui/icons-material/BarChartOutlined"; 
import PieChartOutlineOutlinedIcon from "@mui/icons-material/PieChartOutlined"; 
import TimelineOutlinedIcon from "@mui/icons-material/TimelineOutlined"; 
import MenuOutlinedIcon from "@mui/icons-material/MenuOutlined"; 
import MapOutlinedIcon from "@mui/icons-material/MapOutlined"; 

const Item = ({ title, to, icon, selected, setSelected }) => {
    const theme = useTheme();
    const colors = tokens(theme.palette.mode);
    return (
      <MenuItem
        active={selected === title} //this is required to use react pro side bar
        style={{
          color: colors.grey[100],
        }}
        onClick={() => setSelected(title)}
        icon={icon}
      >
        <Typography>{title}</Typography>
        <Link to={to} />
      </MenuItem>
    );
  };


const Sidebar = () => {
    const theme = useTheme();
    const colors = tokens(theme.palette.mode);
    const[isCollapsed, setIsCollapsed] = useState(false);  //is whether side bar is collapsed or not
    const [selected, setSelected] = useState('Dashboard');  //what page we are currently at

    return (
        <Box
          sx={{
            border: `3px solid ${'#797979'}`,
            borderRadius: theme.shape.borderRadius,
            outline: `1px solid ${'#797979'}`,
            "& .pro-sidebar-inner": {
              background: `${'#000000'} !important`,
            },
            "& .pro-icon-wrapper": {
              backgroundColor: "transparent !important",
            },
            "& .pro-inner-item": {
              padding: "5px 35px 5px 20px !important",
            },
            "& .pro-inner-item:hover": {
              color: "#868dfb !important",
            },
            "& .pro-menu-item.active": {
              color: "#6870fa !important",
            },
          }}
        >
          <ProSidebar collapsed={isCollapsed}>
            <Menu iconShape="square">
              {/* LOGO AND MENU ICON */}
              <MenuItem
                onClick={() => setIsCollapsed(!isCollapsed)}  //below code is meaning that when you collapse, you get the menu icon which is the hamburger bar. after that is styling the icon
                icon={isCollapsed ? <MenuOutlinedIcon /> : undefined}
                style={{
                  margin: "10px 0 20px 0",
                  color: colors.grey[100],
                }}
              >
                {!isCollapsed && ( //the pieces of code here are making it so that if your sidebar is NOT collapsed, you will see your logo, and your hamburger bar.
                  <Box
                    display="flex"
                    justifyContent="space-between"
                    alignItems="center"
                    ml="15px"
                  > 
                  {/* THIS IS THE FIELDDOCK LOGO*/}
                   <div style={{ display: "flex", alignItems: "center" }}>
                    <img src="../../assets/FieldDock_Logo.png" alt="" style={{ width: "20px", height: "20px" }}/>
                    <Typography variant="h3" color={colors.grey[100]}>
                      FieldDock
                    </Typography>
                  </div>
                    <IconButton onClick={() => setIsCollapsed(!isCollapsed)}>
                      <MenuOutlinedIcon />
                    </IconButton>
                  </Box>
                )}
              </MenuItem>
                    {/*USER ICON PHOTO*/}
              {!isCollapsed && (
                <Box mb="25px">
                  <Box display="flex" justifyContent="center" alignItems="center">
                    <img
                      alt="profile-user"
                      width="100px"
                      height="100px"
                      src={`../../assets/user.png`}
                      style={{ cursor: "pointer", borderRadius: "50%" }}
                    />
                  </Box>
                  {/*STYLING FOR NAME*/}
                  <Box textAlign="center">
                    <Typography
                      variant="h2"
                      color={colors.grey[100]}
                      fontWeight="bold"
                      sx={{ m: "10px 0 0 0" }}
                    >
                      Jake 
                    </Typography>
                    {/*STYLING FOR TITLE OF USER*/}
                    <Typography variant="h5" color={'#00e1b4'}>
                      Data Scientist
                    </Typography>
                  </Box>
                </Box>
              )}

              {/* MENU ITEMS */}
              <Box paddingLeft={isCollapsed ? undefined : "10%"}>
            <Item
              title="Dashboard"
              to="/"
              icon={<HomeOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />
            {/* Heading on Sidebar */}
            <Typography
              variant="h6"
              color={'#00e1b4'}
              sx={{ m: "15px 0 5px 20px" }}
            >
              Data
            </Typography>
            <Item
              title="Manage Team"
              to="/team"
              icon={<PeopleOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />
            <Item
              title="Contacts Information"
              to="/contacts"
              icon={<ContactsOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />
            <Item
              title="Logs"
              to="/invoices"
              icon={<ReceiptOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />


            {/* Heading on Sidebar */}
            <Typography
              variant="h6"
              color={'#00e1b4'}
              sx={{ m: "15px 0 5px 20px" }}
            >
              Charts
            </Typography>
            <Item
              title="Bar Chart"
              to="/bar"
              icon={<BarChartOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />
            <Item
              title="Pie Chart"
              to="/pie"
              icon={<PieChartOutlineOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />
            <Item
              title="Line Chart"
              to="/line"
              icon={<TimelineOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />
            <Item
              title="Geography Chart"
              to="/geography"
              icon={<MapOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />
            {/* Heading on Sidebar */}
            <Typography
              variant="h6"
              color={'#00e1b4'}
              sx={{ m: "15px 0 5px 20px" }}
            >
              Pages
            </Typography>
            <Item
              title="Profile Form"
              to="/form"
              icon={<PersonOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />
            <Item
              title="Calendar"
              to="/calendar"
              icon={<CalendarTodayOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />
            <Item
              title="FAQ Page"
              to="/faq"
              icon={<HelpOutlineOutlinedIcon />}
              selected={selected}
              setSelected={setSelected}
            />

              </Box>
            </Menu>
         </ProSidebar>
        </Box>
    );
};

export default Sidebar;
